$(function() {
    $("#predict-button").mouseenter(function(){
        $("#predict-button").css("background-color", "#7cb7e8");
        $("#predict-button").css("color", "#f8f9fa");
    });

    $("#predict-button").mouseleave(function(){
        $("#predict-button").css("background-color", "#f8f9fa");
        $("#predict-button").css("color", "#7cb7e8");
    });

    $('#predict-button').click(function(event){
        getPrediction(event);
    });
});

// show prediction result
function getPrediction(event){
    event.preventDefault();
    //add input
    var routeDistance = parseInt($("#predict-route-distance").val());
    var acrossCBD = $("#predict-whether-across-CBD").val() == "across-CBD" ? 0 : 1;
    var totalStops = parseInt($("#predict-total-stops").val());
    var features = [routeDistance, acrossCBD, totalStops];
    // prediction
    var prediction = new RandomForestClassifier().predict(features);
    var result = [];
    if (prediction == 0){
        result = [0, 100, 0];
    }else if (prediction == 1){
        result = [100, 0, 0];
    }else{
        result = [0, 0, 100];
    }
    $("#prediction-result").remove();
    $('<h3 class="col-12 my=2" id ="prediction-result"></h3>').insertAfter("#search-bar");
    // draw result in spiderweb chart
    Highcharts.chart('prediction-result', {
        chart: {
            polar: true,
            type: 'line'
        },
        title: {
            text: 'Prediction result for the selected route',
            x: 0
        },
        pane: {
            size: '80%'
        },
        xAxis: {
            categories: ['On time', 'Early', 'Late'],
            tickmarkPlacement: 'on',
            lineWidth: 0
        },
        yAxis: {
            gridLineInterpolation: 'polygon',
            lineWidth: 0,
            min: 0
        },
        tooltip: {
            shared: true,
            pointFormat: '<span style="color:{series.color}"><b>{point.y: .0f}%</b><br/>'
        },
        series: [{
            name: 'route performance',
            pointPlacement: 'on',
            data: result
        }],
        credits: {
            enabled: false
        }
    });
}

